  false,\n\t\"url\": null,\n\t\"notes\": \"BTS metadata states u0096 u0093The Intermodal
  Terminal Facilities data set contains geographic data for trailer-on-flatcar (TOFC)
  and container-on-flatcar (COFC) highway rail and/or rail-water transfer facilities
  in the United States. Attribute data specify the intermodal connections at each
  facility; i.e., the modes involved in the transfer, the AAR reporting marks of the
  railroad serving the facility, the type of cargo (always containers/trailers), and
  the direction of the transfer.u0094 Attributes are largely from 1996-97. Because
  of the frequent turnover of this type of facility, some of the terminals included
  in the database may now be dormant or permanently closed.\"\",\n\t\"license_title\":
